import React from "react";

export default class ListWidgetComponent extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            elements: false,
        }
    }

    componentDidMount() {
        const { requestUrl } = this.props;
        const url = 'http://localhost:5000' + requestUrl;
        console.log(url);
        this.setState({
            elements: true
        })
        fetch('http://localhost:5000' + requestUrl)
            .then(res => res.json())
            .then(result => this.setState({
                elements: result
            }));
        console.log(this.state.elements);
    }

    render() {
        return(
            <span>
                {this.props.msg}
            </span>
        );
    }
};
